@powerhungryperformance got this thing DIALED IN 🔥🔥🔥 she’s a ripper for the stock HPOP, @fullforcedieselperformance Stage 2 injectors, @bankspower intercooler, boost tubes + turbo upgrades! The new @riffraffdiesel cvd fittings, banjo bolts and fuel spring are also allowing me full flow to these injectors! The stage 2 trans with a single disk TQ converter I built seems to be taking the abuse! If you have a 7.3L and hydra imma go over PHP’s Titan Unlock in the next video! 
